你能够调用以下的API:
{'name': 'Feedback.query_participant_feedback', 'description': 'This function queries participant feedback for a specific education program.', 'required_parameters': [{'name': 'program', 'type': 'STRING', 'description': 'The education program to query feedback for.'}, {'name': 'feedback_type', 'type': 'STRING', 'description': 'The type of feedback to collect, such as Survey or Interview.'}], 'return_data': [{'name': 'feedback', 'description': 'A list of participant feedback entries, each containing the participant ID, feedback text, and date.'}]}
请直接生成JSON格式的回复. 不要在回复中增加注释(//).

{
    // 你这一步的目标
    "目标": string;
    // 你要调用的API名称
    "名称": string;
    // 当前API的参数输入(JSON格式)
    "参数输入": Record<string, any>;
}
